  }
  await helper.waitForElementToBeVisible(signUp.email);
  await helper.waitForElementToBeVisible(signUp.firstName);
  await helper.waitForElementToBeVisible(signUp.lastName);
  await helper.replaceInputValue(signUp.firstName, '', chance.name());
  await helper.replaceInputValue(signUp.lastName, '', chance.name());
  await helper.replaceInputValue(signUp.email, '', config.site.login.user);
  await helper.waitForElementToBeVisible(signUp.requestAccess);
  await helper.clickElement(signUp.requestAccess);
  await helper.waitForElementToBeVisible(signUp.emailErrorMsg);
  expect((await signUp.emailErrorMsg.getText())).to.include(CONSTANTS.ERROR_MESSAGE.unableToRegister);
});

await step('Verify Signup with new email', this, async () => {
  const firstName = chance.name();
  const lastName = chance.name();
  const url = await browser.getCurrentUrl();
  if (url.includes(CONSTANTS.ROUTE.chooseLogin)) {
    await helper.waitForElementToBeVisible(login.signupBtn);
    await helper.clickElement(login.signupBtn);
  }
  if (url.includes(CONSTANTS.ROUTE.requestNewUser)) {
    await helper.waitForElementToBeVisible(signUp.email);
    await helper.waitForElementToBeVisible(signUp.firstName);
    await helper.waitForElementToBeVisible(signUp.lastName);
  }
  await helper.replaceInputAndSaveValue(signUp.firstName, '', firstName);
  await helper.replaceInputAndSaveValue(signUp.lastName, '', lastName);
  await helper.replaceInputAndSaveValue(signUp.email, '', chance.email());
  await helper.waitForElementToBeVisible(signUp.requestAccess);
  await helper.clickElement(signUp.requestAccess);
  expect((await helper.waitForUrlToHave(CONSTANTS.ROUTE.requestNewUserSent))).to.be.true;
});
